import React from 'react';

const ContactForm = () => {
    return(

      <div className="ContactForm">
          <h1>Contact Form</h1>

          <form>
              <h3> First Name</h3>
              <input placeholder="First Name"/>
          </form>
      </div>

    );
}

export default ContactForm;
